import React from 'react';
import ReactDOM from 'react-dom';

import { Route, BrowserRouter as Router } from 'react-router-dom'

import TraderInterface from './trader_interface.js';
import Login from './login_page.js';
import './index.css';

class ExchangeInterface extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            websocket: null
        }
    }

    connect(host){
        this.setState((state, props) => {
            return {
                websocket: new WebSocket(props.exchange_host)
            }
        });
    }

    send(data){
        this.state.websocket.send(data);
    }
}

class Root extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            websocket: null
        }
    }
}


class Main extends React.Component {
    render() {
        return (
                <div className="main">
                <div className="main-trader-interface">
                <TraderInterface />
                </div>
                </div>
               );
    }
}

// ========================================

const routing = (
  <Router>
    <div>
      <Route exact path="/" component={Login} />
      <Route path="/TraderInterface" component={Main} />
<CSSTransition
                  key={location.key}
                  classNames="fade"
                  timeout={300}
                >
                  <Switch location={location}>
                    <Route exact path="/hsl/:h/:s/:l" component={HSL} />
                    <Route exact path="/rgb/:r/:g/:b" component={RGB} />
                    {/* Without this `Route`, we would get errors during
                    the initial transition from `/` to `/hsl/10/90/50`
                */}
                    <Route render={() => <div>Not Found</div>} />
                  </Switch>
                </CSSTransition>
    </div>
  </Router>
)

ReactDOM.render(routing, document.getElementById('root'))
